#include <stdbool.h>
#include <stdio.h>
#include <stdlib.h>

/* Constants */
#define GRAVITY 9.81

/* VGA Display Parameters */
volatile int pixel_buffer_start; 
short int Buffer1[240][512];
short int Buffer2[240][512];
volatile int *pixel_ctrl_ptr = (int *)0xFF203020;

/* Structs */
typedef struct {
    int x;
    int y;
} Position;

typedef struct {
    int x;
    int y;
} Velocity;

typedef struct {
    int score;
    char name[10]; // 10 characters max name
} Player;

typedef struct {
    Position initialPos;
    Position currentPos;
    float startingAngle;
    Velocity initialVel;
    Velocity currentVel;
    bool isMoving;
    Player owner;
} Basketball;

typedef enum {
    INITIALIZING,
    PLAYING,
    GAME_OVER,
} GameState;

typedef struct {
    Player currentTurn;
    Basketball currentBall;
    Player player1;
    Player player2;
    int currentTime;
    int maxTime;
    int currentRound;
    int maxRounds;
    bool isGameOver;
    GameState currentState;
} Game;

/* VGA Graphics Functions Prototypes */
void plot_pixel(int x, int y, short int r, short int g, short int b);
void clear_screen();
void wait_for_vsync();

void draw_image(int image[]);

/* Game Logic Functions Prototypes */
void initializeGame(Game *game);
void updateBasketball(Basketball *ball, int deltaTime);
void updateGame(Game *game, int deltaTime);


int main(void) {

    /* set front pixel buffer to Buffer 1 */
    *(pixel_ctrl_ptr + 1) = (int)&Buffer1;  // first store the address in the  back buffer
    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();
    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen();  // pixel_buffer_start points to the pixel buffer

    /* set back pixel buffer to Buffer 2 */
    *(pixel_ctrl_ptr + 1) = (int)&Buffer2;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // we draw on the back buffer
    clear_screen();                              // pixel_buffer_start points to the pixel buffer

    // Initialize the game
    Game game;
    initializeGame(&game);

    // Main game loop
    while (!game.isGameOver) {
        switch (game.currentState) {
            case INITIALIZING:
                printf("Game initialized\n");
                draw_image(start_screen);
                // game.currentState = PLAYING; // transition to PLAYING state
                break;
            case PLAYING:
                printf("Game started\n");
                // Update the game
                updateGame(&game, 1); // Update the game every 1 ms

                if (game.currentTime >= game.maxTime || game.currentRound > game.maxRounds) {
                    game.currentState = GAME_OVER;
                }
                break;
            case GAME_OVER:
                game.currentState = INITIALIZING; // Restart the game
                break;
        }
    
        wait_for_vsync(); // Swap buffers
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // Back buffer
    }

    // Initialize the VGA display
    return 0;
}

/* -------------------------------------------------------------------------- */
/*                       VGA Graphics subroutines                             */
/* -------------------------------------------------------------------------- */

void plot_pixel(int x, int y, short int r, short int g, short int b) {
    volatile short int *one_pixel_address;
    one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
    // use RGB565 format for pixel color
    *one_pixel_address = ((r & 0x1F) << 11) | ((g & 0x3F) << 6) | (b & 0x1F);
}

void clear_screen() {
    int x, y;
    for (x = 0; x < 320; x++)
        for (y = 0; y < 240; y++)
            plot_pixel(x, y, 0x0000, 0x0000, 0x0000);  // clear pixel at (x, y)
}

void wait_for_vsync() {
    {
        int status;
        *pixel_ctrl_ptr = 1;  // start the synchronization process
        // - write 1 into front buffer address register
        status = *(pixel_ctrl_ptr + 3);  // read the status register
        while ((status & 0x01) != 0)     // polling loop waiting for S bit to go to 0
        {
            status = *(pixel_ctrl_ptr + 3);
        }
    }
}

void draw_image(int image[]) {
    int x, y;
    for (x = 0; x < 320; x++) {
        for (y = 0; y < 240; y++) {
            plot_pixel(x, y, image[y * 320 + x], image[y * 320 + x + 1], image[y * 320 + x + 2]);
        }
    }
}

